    public function checkErrors()
    {
        $this->logger->notice(__METHOD__);
        /*
         * The site is currently unavailable due to a system upgrade.
         * We value your business and apologize for any inconvenience.
         * Please try again later or call Cardmember Service at the phone number on the back of your credit card for questions about your account.
         */
        if ($message = $this->http->FindSingleNode("//div[contains(text(), 'The site is currently unavailable due')]")) {
            throw new CheckException($message, ACCOUNT_PROVIDER_ERROR);
        }

        if ($this->http->FindSingleNode("//h2[contains(text(), '500 - Internal server error.')]")) {
            throw new CheckException(self::PROVIDER_ERROR_MSG, ACCOUNT_PROVIDER_ERROR);
        }

        return false;
    }

