    public function checkProviderErrors()
    {
        $this->logger->notice(__METHOD__);
        $response = $this->http->JsonLog(null, 5);
        // We are experiencing Technical Difficulties.
        if ($this->http->currentUrl() == 'https://login.fidelityrewards.com/onlineCard/fatalError.do') {
            throw new CheckException("We are experiencing Technical Difficulties. If the problem persists, please contact Technical Support listed on the back of your card.", ACCOUNT_PROVIDER_ERROR);
        }
        /*
        * We are unable to verify the information you've entered. Please confirm your Personal ID and Password.
        * If you have not enrolled, select the "Enroll Now" option. If the problem persists, please contact Technical Support at 1-877-334-0460.
        */
        if ($this->http->currentUrl() == 'https://login.fidelityrewards.com/onlineCard/login.do?error=invalid_credentials') {
            throw new CheckException('We are unable to verify the information you\'ve entered. Please confirm your Personal ID and Password. If you have not enrolled, select the "Enroll Now" option. If the problem persists, please contact Technical Support at 1-877-334-0460.', ACCOUNT_INVALID_PASSWORD);
        }
        /*
         * Online access to this account has been restricted.
         * For assistance, please visit online Account Assistance or call Cardmember Service at the number on the back of your card.
         */
        if ($this->http->currentUrl() == 'https://login.fidelityrewards.com/onlineCard/login.do?error=locked') {
            throw new CheckException("Online access to this account has been restricted. For assistance, please visit online Account Assistance or call Cardmember Service at the number on the back of your card.", ACCOUNT_LOCKOUT);
        }

        // retry
        if ($this->http->Response['body'] == '{"result":"internalError","serviceCode":null}') {
            throw new CheckRetryNeededException(2);
        }

        $error = $response->errors->globalErrors[0] ?? $response->errors->fieldErrors[0]->answer ?? null;

        if ($error) {
            $this->logger->error("[Error]: {$error}");
            // Answer to your ID Shield Question is invalid.
            if (strstr($error, 'Answer to your ID Shield Question is invalid.')) {
                return $error;
            }
            // The answer to the question should contain letters, numbers, and spaces only. Please re-enter your answer.
            if (strstr($error, 'The answer to the question should contain letters, numbers, and spaces only.')) {
                return $error;
            }
            // The answer to the question needs to be at least 2 characters long.
            // The answer to the question needs to be at least 5 characters long.
            if (strstr($error, 'The answer to the question needs to be at least ') && strstr($error, 'characters long.')) {
                return $error;
            }
            // The answer to the question should contain numbers only. Please re-enter your answer.
            if (strstr($error, 'The answer to the question should contain numbers only.')) {
                return $error;
            }
            // The answer to the question should contain letters, numbers, and spaces only.
            if (strstr($error, 'The answer to the question should contain letters, numbers, and spaces only.')) {
                return $error;
            }
            // The answer to the question needs to be at least 4 characters long.
            if (strstr($error, 'The answer to the question needs to be at least 4 characters long.')) {
                return $error;
            }

            if (strstr($error, 'We are unable to verify the information you\'ve entered.')) {
                throw new CheckException($error, ACCOUNT_INVALID_PASSWORD);
            }

            // Online access to this account has been restricted.
        }// if (isset($response->errors->globalErrors[0]))
        // The answer to your question must be a valid date. Please re-enter a valid date.
        if ($error = $this->http->FindPreg("/\"answer\":\"(The answer to your question must be a valid date\.\s*Please re-enter a valid date\.)\"/ims")) {
            return $error;
        }
        // The answer to the question should contain letters, numbers, and spaces only.
        if ($error = $this->http->FindPreg("/\"answer\":\"(The answer to the question should contain letters, numbers, and spaces only\.\s*Please re-enter your answer\.)\"/ims")) {
            return $error;
        }
        // Answer to your ID Shield Question is invalid.
        if ($error = $this->http->FindPreg("/\"globalErrors\":\[\"(Answer to your ID Shield Question is invalid\.)\"/")) {
            return $error;
        }
        /*
         * Online access to this account has been restricted.
         * For assistance, please visit online Account Assistance or call Cardmember Service at the number on the back of your card.
         */
        if ($this->http->FindPreg("/\"globalErrors\":\[\"Online access to this account has been restricted\./")) {
            throw new CheckException("Online access to this account has been restricted.", ACCOUNT_LOCKOUT);
        }

        return false;
    }

    public function Parse()
    {
        $this->http->GetURL("https://login.fidelityrewards.com/onlineCard/public/publicAppInfo.action?&host=login.fidelityrewards.com&timestamp=" . date("UB"));
        $response = $this->http->JsonLog(null, 3, true);
        $this->csrf = ArrayVal($response, 'csrf-token', null);

        if (!$this->csrf) {
            return;
        }

        // Sorry! This feature isn't responding. Please try again later.
        $accountWithErroronRewardsPage = false;

        $data = [
            "host"      => "login.fidelityrewards.com",
            "timestamp" => date("UB"),
            "partner"   => "fid",
            "CSRFToken" => $this->csrf,
        ];
        $this->http->PostURL('https://login.fidelityrewards.com/onlineCard/authenticatedAppInfo.action?timestamp=' . date("UB"), $data);
        $response = $this->http->JsonLog(null, 3, true);
        $customerDetailAccountListSize = ArrayVal($response, 'customerDetailAccountListSize', null);
        $result = ArrayVal($response, 'result', null);
        // Name
        $this->SetProperty("Name", beautifulName(ArrayVal($response, 'selectedAccountName')));

        if ($result == 'internalError') {
            $headers = [
                "Accept"          => " */*",
                "Accept-Language" => "en-US,en;q=0.5",
                "Referer"         => "https://login.fidelityrewards.com/",
                "Content-Type"    => "application/json",
                "Service-Version" => "2",
                "authorization"   => "Bearer " . ($this->apiTokenValue ?? $this->accesstoken /* AccountID: 3333748 */),
                "routingKey"      => "",
                "application-id"  => "RPCAPPLAUNCH",
                //                "Correlation-ID"  => "c6fc1ac0-720f-11ed-a33c-f3d70f8cb677",
                "Origin"          => "https://login.fidelityrewards.com",
            ];

            $this->http->PostURL("https://api.usbank.com/partner-services/graphql/v1", '{"query":"\nquery customer($input: ProfileInput!) {\n  customer(input: $input) {\n    customer {\n      accounts {\n        accountToken\n        productCode\n        hashedChitl\n        externalChitl\n        ... on CreditAccount {\n          details {\n          cardLast4PAN\n          outsourcingEAC\n          }\n        }\n      }\n      personal {\n        customerType{\n          typeCode\n        }\n        contact {\n          email {\n            emailID\n          }\n        }\n      }\n    }\n  }\n}","variables":{"input":{"identifier":"' . $this->AccountFields['Login'] . '","identifierType":"UID","selection":{"additionalAddressType":"CL","includeMailingAddress":true,"includeContactDetail":true,"includeAlternateEmail":true}}}}', $headers);
            $customers = $this->http->JsonLog()->data->customer->customer ?? [];

            foreach ($customers as $customer) {
                foreach ($customer->accounts as $account) {
                    $this->http->PostURL("https://api.usbank.com/partner-services/graphql/v1", '{"query":"query accounts(\n  $accountInput: AccountInput\n) {\n  accounts(accountInput: $accountInput) {\n    accountToken    \n    productCode\n    subProductCode\n    accountNumber\n    accountType   \n    displayName\n    nickname   \n    statusCode\n    ... on CreditAccount {\n      balances {\n        availableCredit\n        currentBalance        \n        creditLimit\n        availableCash       \n        pendingTransactionAmount\n      }\n    }\n    ... on CreditAccount {\n      details {\n        lastPaymentAmount\n        lastPaymentDate       \n        isEnrolledInSettlement       \n        cardLast4PAN     \n        customerServicePhoneNumber\n        rewardsSystemOfRecord\n        yearToDateInterestPaid\n        paymentIndicator \n        productBrandName\n        statementDetails {\n          paymentDueDate\n          pastDueAmount\n          minimumPaymentDue\n          lastStatementBalance\n          lastStatementDate\n          nextStatementClosingDate\n          totalCreditsSinceLastStatementAmount\n          totalDebitsSinceLastStatementAmount\n        }\n        isInRewardsProgram  \n        isEligibleForCredentials    \n      }\n    } \n  } \n}\n","variables":{"accountInput":{"accountTokens":["' . $account->accountToken . '"],"identifierType":"ACCOUNTTOKEN"}}}', $headers);

                    $customerAccounts = $this->http->JsonLog(null, 3, false, 'productBrandName')->data->accounts ?? [];

                    foreach ($customerAccounts as $customerAccount) {
                        $number = $customerAccount->accountNumber;
                        $code = 'fidelity' . $number;
                        $displayName = $customerAccount->details->productBrandName . " ..." . $number;

                        $this->logger->info("{$displayName} card #{$number}", ['Header' => 3]);

                        $this->AddDetectedCard([
                            "Code"            => $code,
                            "DisplayName"     => $displayName,
                            "CardDescription" => C_CARD_DESC_DO_NOT_EARN,
                        ]);

                        if ($customerAccount->details->isInRewardsProgram !== true) {
                            // AccountID: 4384155
                            $this->logger->notice("skip card without rewards");
                            $accountWithErroronRewardsPage = true;

                            continue;
                        }

                        $this->logger->info("{$displayName}", ['Header' => 3]);
                        $this->logger->notice("Loading account summary for {$displayName}");

                        $this->http->PostURL("https://api.usbank.com/partner-services/graphql/v1", '{"query":"query CreditRewardSummary($creditRewardSummaryInput: CreditRewardSummaryInput){\n    CreditRewardSummary(creditRewardSummaryInput: $creditRewardSummaryInput){\n         rewardsTypeCode \n         rewardType\n         rewardsVendor\n         currentRewardsBalancePoints\n         currentRewardsBalance\n    }\n }","variables":{"creditRewardSummaryInput":{"accountTokens":["' . $customerAccount->accountToken . '"],"identifierType":"ACCOUNTTOKEN"}}}', $headers);
                        $creditRewardSummaryResponse = $this->http->JsonLog(null, 3, false, 'currentRewardsBalance');
                        $creditRewardSummary = $creditRewardSummaryResponse->data->CreditRewardSummary;

                        $this->AddDetectedCard([
                            "Code"            => $code,
                            "DisplayName"     => $displayName,
                            "CardDescription" => C_CARD_DESC_ACTIVE,
                        ], true);

                        if ($creditRewardSummary === null) {
                            if (
                                isset($creditRewardSummaryResponse->errors[0]->message)
                                && $creditRewardSummaryResponse->errors[0]->message == 'Internal Server error'
                            ) {
                                $this->logger->notice("Internal Server error");
                                $accountWithErroronRewardsPage = true;
                            }

                            continue;
                        }// if ($creditRewardSummary === null)

                        $this->AddSubAccount([
                            "Code"        => $code,
                            "DisplayName" => $displayName,
                            "Balance"     => $creditRewardSummary[0]->currentRewardsBalancePoints,
                        ], true);
                    }// foreach ($customerAccounts as $customerAccount)
                }// foreach ($customer->accounts as $account)
            }// foreach ($customers as $customer)
        } else {
            // Multiple accounts
            $selectedAccountShortNumber = ArrayVal($response, 'selectedAccountShortNumber');

            if ($customerDetailAccountListSize != 1) {
                $data = [
                    "userId"    => $this->AccountFields['Login'],
                    "timestamp" => time() . date("B"),
                    "partner"   => "fid",
                    "CSRFToken" => $this->csrf,
                ];
                $this->http->PostURL('https://login.fidelityrewards.com/onlineCard/accountSummary.action?timestamp=' . date("UB"), $data);
                $response = $this->http->JsonLog(null, 3, true);
                $consumerJson = ArrayVal($response, 'consumerJson', []);
                $this->logger->debug("Total " . (is_array($consumerJson) ? count($consumerJson) : "not array") . " cards were found");
                $allCardsInfo = [];

                foreach ($consumerJson as $card) {
                    $accountIndex = ArrayVal($card, 'accountIndex', null);
                    $accountNumber = ArrayVal($card, 'shortNumber', null);
                    $displayName = ArrayVal($card, 'productName', null);
                    $this->logger->debug("{$displayName}...{$accountNumber} => {$accountIndex}");
                    $allCardsInfo[$accountNumber] = [
                        "accountIndex" => $accountIndex,
                        "shortNumber"  => $accountNumber,
                        "displayName"  => $displayName . " ..." . $accountNumber,
                    ];
                }// foreach ($cards as $card)

                foreach ($allCardsInfo as $number => $info) {
                    $this->logger->info("{$info['displayName']}", ['Header' => 3]);
                    $this->logger->notice("Loading account summary for {$info['displayName']} => {$info['accountIndex']}");
                    $data = [
                        "userId"    => $this->AccountFields['Login'],
                        "timestamp" => time() . date("B"),
                        "partner"   => "fid",
                        "CSRFToken" => $this->csrf,
                        "index"     => $info['accountIndex'],
                        "shortNum"  => $info['shortNumber'],
                    ];
                    $this->http->PostURL("https://login.fidelityrewards.com/onlineCard/accountSummary.action?phase=transactionDetails&timestamp=" . date("UB"), $data);
                    $this->http->JsonLog(null, 3, true);
                    $this->parseCard($info['displayName'], $info['shortNumber']);
                }// foreach ($allCardsInfo as $number => $info)

                // AccountID: 3998447
                if (count($consumerJson) == 0 && ArrayVal($response, 'businessUser') == true) {
                    //                $this->sendNotification("fidelity - business account");
                    $businessJson = ArrayVal($response, 'businessUser', []);
                    $this->logger->debug("Total " . (is_array($businessJson) ? count($businessJson) : "not array") . " business cards were found");
                    $this->parseCard("Main", $selectedAccountShortNumber, true);
                }// if (count($consumerJson) == 0 && ArrayVal($response, 'businessUser') == true)
            }// if ($customerDetailAccountListSize != 1)
            else {
                $this->parseCard("Main", $selectedAccountShortNumber);
            }
        }

        if (isset($this->Properties['SubAccounts']) && count($this->Properties['SubAccounts']) > 0) {
            $this->SetBalanceNA();

            if (count($this->Properties['SubAccounts']) > 1) {
                $subAccountBalance = 0;

                foreach ($this->Properties['SubAccounts'] as &$subAccount) {
                    $subAccountBalance += floatval(str_replace([',', '.'], ['', ','], $subAccount['Balance']));
                    $subAccount['BalanceInTotalSum'] = true;
                }

                $this->SetBalance($subAccountBalance);
            }
            // AccountID: 4384155
        } elseif ($accountWithErroronRewardsPage === true && !empty($this->Properties['DetectedCards'])) {
            $this->SetBalanceNA();
        }
    }

    public function parseCard($displayName, $number = null, $business = false)
    {
        $this->logger->notice(__METHOD__);
        // Account Ending in ...
        if (!$number) {
            return;
        }
        $this->logger->info("{$displayName} card #{$number}", ['Header' => 3]);
        $code = 'fidelity' . $number;
        // detected cards
        if ($displayName != "Main") {
            $this->AddDetectedCard([
                "Code"            => $code,
                "DisplayName"     => $displayName,
                "CardDescription" => C_CARD_DESC_DO_NOT_EARN,
            ], true);
        }

        $this->logger->notice("Redirect to Rewards Center page...");
        $this->http->GetURL("https://login.fidelityrewards.com/onlineCard/rewardsCenterRedirect.do");
        $this->logger->notice("Get SAMLResponse page...");
        $this->http->GetURL("https://login.fidelityrewards.com/onlineCard/rewardsCenterRedirect.do?phase=forwardToPingFederate");

        if (!$this->http->ParseForm(null, "//form[contains(@action, 'AssertionConsumerService')]")) {
            return;
        }
        $this->http->PostForm();

        // Internal Error
        if ($this->http->FindSingleNode("//h2[contains(text(), 'Internal Error')]")
            && $this->http->FindPreg("/We are experiencing Technical Difficulties\./")
            && $this->http->currentUrl() == 'https://login.fidelityrewards.com/onlineCard/internalError.do') {
            throw new CheckException(self::PROVIDER_ERROR_MSG, ACCOUNT_PROVIDER_ERROR);
        }

        $this->logger->notice("Get Balance info...");
//        $this->http->GetURL("https://redeem.myrewardsaccess.com/Login/IsUserLoggedIn?".$this->random());
        $this->http->GetURL("https://redeem.myrewardsaccess.com/content/usbankrewards/global/services/profile.member.json");
        $response = $this->http->JsonLog(null, 3, true);
//        if ($business)
//            $profile = ArrayVal($response, 'ProfileCBA');
//        else
//            $profile = ArrayVal($response, 'Profile');
        // Balance - You have ... Points
        $balance = ArrayVal($response, 'pointBalance', null);

        if (isset($balance)) {
            $account = [
                'Code'        => $code,
                'DisplayName' => $displayName,
                'Balance'     => $balance,
                'Number'      => $number,
            ];
            // detected cards
            if ($displayName != 'Main') {
                $this->AddDetectedCard([
                    "Code"            => $code,
                    "DisplayName"     => $displayName,
                    "CardDescription" => C_CARD_DESC_ACTIVE,
                ], true);
            }

            /*
            $this->logger->notice("Loading details...");
            $this->http->GetURL("https://redeem.myrewardsaccess.com/Points/GetPointSummary?_a=".$this->random());
            $response = $this->http->JsonLog(null, 3, true);
            // Earned
            $account["Earned"] = ArrayVal($response, 'TotalPointEarnedForAccount');
            // Redeemed
            $account["Redeemed"] = ArrayVal($response, 'TotalPointsRedeemedForAccount');
            // Adjusted
            $account["Adjusted"] = ArrayVal($response, 'TotalPointsAdjustedForAccount');

            // Loading page with expiration dates
            if ($balance > 0) {
                $this->logger->notice("Loading page with expiration dates...");
                $this->http->GetURL("https://redeem.myrewardsaccess.com/Points/GetPointsToExpire?_a=".$this->random());
                $response = $this->http->JsonLog(null, 3, true);
                $allPointsToExpire = ArrayVal($response, 'AllPointsToExpire', []);
                $this->logger->debug("Total ".count($allPointsToExpire)." expiration dates were found");
                foreach ($allPointsToExpire as $pointsToExpire) {
                    $date = ArrayVal($pointsToExpire, 'ExpirationDate');
                    $expiringPoints = ArrayVal($pointsToExpire, 'NumPoints');
                    $this->logger->debug("date: {$date}");
                    if ((!isset($exp) || $exp > strtotime($date)) && $expiringPoints > 0) {
                        $exp = strtotime($date);
                        $account["PointsToExpire"] = $expiringPoints;
                        $account["ExpirationDate"] = $exp;
                    }// if ((!isset($exp) || $exp > strtotime($date)) && $expiringPoints > 0)
                }// foreach ($allPointsToExpire as $pointsToExpire)
            }// if ($balance > 0)
            */

            $this->AddSubAccount($account, true);
        }// if (isset($balance))
        elseif ($this->ErrorCode == ACCOUNT_ENGINE_ERROR) {
            /*
             * We are making enhancements to your Rewards Center
             *
             * The site is currently not available
             *
             * We apologize for the inconvenience
             */
            /*
             * The pages you are trying to access are temporarily unavailable. Please check back later when everything is back to normal.
             */
            if ($message = $this->http->FindSingleNode("
                    //div[contains(text(), 'We are making enhancements to your Rewards Center')]
                    | //p[contains(text(), 'We are making enhancements to your Rewards Center')]
                    | //p[contains(text(), 'The pages you are trying to access are temporarily unavailable.')]
                ")
            ) {
                throw new CheckException($message, ACCOUNT_PROVIDER_ERROR);
            }
            /*
             * No link 'Rewards Center'
             *
             * Internal Error
             * We're sorry. The Web address you entered is not a functioning page on our site.
             */
            if ($message = $this->http->FindPreg("/\{\"Status\":\"Error\",\"StatusMessage\":\"No Profile\"\}/")) {
                $this->SetBalanceNA();
            }
        }
    }

