    private function selenium()
    {
        $this->logger->notice(__METHOD__);
        $selenium = clone $this;
        $retry = false;
        $this->http->brotherBrowser($selenium->http);
        $seleniumURL = null;

        try {
            $this->logger->notice("Running Selenium...");
            $selenium->UseSelenium();
            $selenium->useFirefox();
            $selenium->setKeepProfile(true);
            $selenium->http->saveScreenshots = true;

            $selenium->http->start();
            $selenium->Start();
            $selenium->http->GetURL("https://login.fidelityrewards.com/onlineCard/login.do");

            $login = $selenium->waitForElement(WebDriverBy::xpath('//input[@name="Username"]'), 10);
            $pass = $selenium->waitForElement(WebDriverBy::xpath('//input[@name="Password"]'), 0);
            $btn = $selenium->waitForElement(WebDriverBy::xpath("//button[@id = 'login-button-continue']"), 0);
            $this->savePageToLogs($selenium);

            if (!$login || !$pass || !$btn) {
                return $this->checkErrors();
            }

            $login->sendKeys($this->AccountFields['Login']);
            $pass->sendKeys($this->AccountFields['Pass']);
            $btn->click();

            $resXpath = '//div[@id = "tc_HeaderLogout"] | //button[contains(text(), "Log out")] | //h1[contains(text(), "We\'ve updated our terms")] | //h2[span[contains(text(), "E-SIGN")]] | //h2[@id = "top-error-msg-single-notification--text"] | //div[@role="alert" and not(@aria-atomic)] | //p[contains(text(), "It looks like your account requires some extra attention.")] | //h1[contains(text(), "We\'ve made a few changes.")] | //h2[span[contains(text(), "Enroll in ID Shield")]] | //div[@id = "top-error-msg-children-notification"]';
            $remindMeLaterXpath = '//button[@data-test-id="remindMeLater"] | //a[@id = "contactDetailsPrompt"] | //p[@class = "error-text__error"]';
            $selenium->waitForElement(WebDriverBy::xpath($resXpath . ' | //div[@id = "kba-input"]/label | ' . $remindMeLaterXpath), 15);
            $question = $selenium->waitForElement(WebDriverBy::xpath('//div[@id = "kba-input"]/label'), 0);
            $this->savePageToLogs($selenium);

            if ($question) {
                $questionInput = $question->getText();

                if (!isset($this->Answers[$questionInput])) {
                    $this->AskQuestion($questionInput, null, "Question");

                    return false;
                }

                $question = $selenium->waitForElement(WebDriverBy::xpath('//div[@id = "kba-input"]/input'), 0);
                $question->sendKeys($this->Answers[$questionInput]);
                $btn = $selenium->waitForElement(WebDriverBy::xpath("//button[@id = 'kba-continue']"), 0);
                $btn->click();
                $res = $selenium->waitForElement(WebDriverBy::xpath($resXpath . " | " . $remindMeLaterXpath), 15);
                $this->savePageToLogs($selenium);

                if ($res && strstr($res->getText(), 'That answer doesnt match. Please try again.')) {
                    $this->AskQuestion($questionInput, $res->getText(), "Question");

                    return false;
                }
            }

            if ($remindMeLater = $selenium->waitForElement(WebDriverBy::xpath($remindMeLaterXpath), 0)) {
                $remindMeLater->click();

                $selenium->waitForElement(WebDriverBy::xpath($resXpath), 15);
                $this->savePageToLogs($selenium);
            }

            $cookies = $selenium->driver->manage()->getCookies();

            foreach ($cookies as $cookie) {
                $this->http->setCookie($cookie['name'], $cookie['value'], $cookie['domain'], $cookie['path'], $cookie['expiry'] ?? null);
            }

            $this->accesstoken = $selenium->driver->executeScript("return sessionStorage.getItem('AccessToken');");
            $this->logger->debug("[Form AccessToken]: " . $this->accesstoken);

            $this->apiTokenValue = $selenium->driver->executeScript("return sessionStorage.getItem('ApigeeOAuthToken');");
            $this->logger->debug("[Form ApigeeOAuthToken]: " . $this->apiTokenValue);

            $seleniumURL = $selenium->http->currentUrl();
            $this->logger->debug("[seleniumURL]: " . $seleniumURL);
        } catch (UnknownServerException | SessionNotCreatedException $e) {
            $this->logger->error("Exception: " . $e->getMessage(), ['HtmlEncode' => true]);
            $this->DebugInfo = "exception";
            $retry = true;
        } finally {
            // close Selenium browser
            $selenium->http->cleanup(); //todo

            // retries
            if ($retry && ConfigValue(CONFIG_SITE_STATE) != SITE_STATE_DEBUG) {
                $this->logger->debug("[attempt]: {$this->attempt}");

                throw new CheckRetryNeededException(3);
            }
        }

        if ($this->http->FindSingleNode('//h1[contains(text(), "We\'ve updated our terms")] | //h1[contains(text(), "We\'ve made a few changes.")]')) {
            $this->throwAcceptTermsMessageException();
        }

        if ($this->http->FindSingleNode('//h2[span[contains(text(), "E-SIGN")]] | //p[contains(text(), "It looks like your account requires some extra attention.")] | //h2[span[contains(text(), "Enroll in ID Shield")]]')) {
            $this->throwProfileUpdateMessageException();
        }

        if ($message =
            $this->http->FindSingleNode('//h2[@id = "top-error-msg-single-notification--text"]')
            ?? $this->http->FindSingleNode('//div[@role="alert" and not(@aria-atomic)]')
            ?? $this->http->FindSingleNode('//p[@class = "error-text__error"]')
            ?? $this->http->FindSingleNode('//div[@id = "top-error-msg-children-notification"]')
        ) {
            $this->logger->error("[Error]: {$message}");
            $message = preg_replace('/^Alert\s*/', '', $message);
            $this->logger->error("[Error]: {$message}");

            if (
                strstr($message, 'Your username and password are incorrect. Please try again.')
                || strstr($message, 'Try again. Passwords are between 8 and 24 characters.')
                || strstr($message, 'Enter your username again. Your username must be between 7 and 22 characters with no spaces.')
            ) {
                throw new CheckException($message, ACCOUNT_INVALID_PASSWORD);
            }

            if (strstr($message, 'We had to lock your account after too many attempts.')) {
                throw new CheckException($message, ACCOUNT_LOCKOUT);
            }

            $this->DebugInfo = $message;

            return false;
        }

        // AccountID: 3786622
        if ($seleniumURL == 'https://login.fidelityrewards.com/onlineCard/fatalError.do') {
            throw new CheckException(self::PROVIDER_ERROR_MSG, ACCOUNT_PROVIDER_ERROR);
        }

        return true;
    }
